import { useEffect } from "react";
import { useSelector } from "react-redux";

export const Likes = () => {

  const { users } = useSelector((state) => state.rickMorty)

  const user = users.find(usr => usr.isLogged === true)

  useEffect(() => {

  })

  return (
    <div className="container">
      {console.log(user.likedCharacters)}
      {
        user !== undefined && user.likedCharacters.length > 0 ? 
        user.likedCharacters.map(like => {
          <div className="d-flex justify-content-between my-2 rounded shadow">
            <img className="float-start rounded img-fluid my-3 me-3" src={like.url} alt={like.name} />
            <h5>Name: <span className="sm">{like.name}</span>, Status: <span className="sm">{}</span></h5> 
          </div>
        }) : 
        <p>No any liked characters</p> 

      }

    </div>
  )
}
